package com.example.foodnow.ui.discover;

import androidx.lifecycle.LiveData;
import androidx.lifecycle.MutableLiveData;
import androidx.lifecycle.ViewModel;

import com.example.foodnow.Restaurant;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class DiscoverViewModel extends ViewModel {

    //list of restaurants
    private MutableLiveData<List<Restaurant>> items;

    public DiscoverViewModel() {
        items = new MutableLiveData<>();
    }

    public MutableLiveData<List<Restaurant>> getItems() {
        List<Restaurant> l = Arrays.asList(
                new Restaurant("a", "b", "", 1, 1, true, new String[]{"pizza", "burgers"}),
                new Restaurant("b", "b", "", 1, 1, true, new String[]{"pizza", "burgers"}),
                new Restaurant("c", "b", "", 1, 1, true, new String[]{"pizza", "burgers"}),
                new Restaurant("d", "b", "", 1, 1, true, new String[]{"pizza", "burgers"}),
                new Restaurant("e", "b", "", 1, 1, true, new String[]{"pizza", "burgers"})
        );

        items.setValue(l);
        return items;
    }
}